(function(dust){dust.register("wallet\/inc\/padTerms",body_0);function body_0(chk,ctx){return chk.w("<div><p class=\"pad_termsConditions\"><b>Partie contractante et sujet du contrat.</b>Le présent accord constitue un contrat passé entre vous et PayPal (Europe) S.à r.l. et Cie S.C.A., complète les Conditions d'utilisation de PayPal et régit en particulier votre utilisation du Paiement après 14 jours.</p><p class=\"pad_termsConditions\"><b>Fonctionnement du Paiement après 14 jours.</b>Lorsque vous effectuez un paiement avec le Paiement après 14 jours, les destinataires reçoivent immédiatement le montant de la transaction sur leur compte PayPal. Le montant de la transaction est débité de votre compte bancaire par prélèvement bancaire, au plus tôt 14 jours après la date de la transaction.</p><p class=\"pad_termsConditions\"><b>Prélèvement bancaire comme source d'approvisionnement.</b>Pour utiliser le Paiement après 14 jours, vous devez avoir enregistré un compte bancaire valide, avoir ajouté ce compte à votre compte PayPal et l'avoir désigné comme votre compte bancaire principal ou votre source d'approvisionnement préférée. Le Paiement après 14 jours ne peut pas être utilisé avec d'autres sources d'approvisionnement, comme une carte bancaire par exemple. Le montant total de la transaction sera prélevé du compte bancaire principal lié à votre compte PayPal, même si vous possédez un solde sur ce compte PayPal.</p><p class=\"pad_termsConditions\">Pour chaque paiement à l'aide du Paiement après 14 jours, vous autorisez PayPal à débiter votre compte bancaire principal du montant total de la transaction, au plus tôt 14 jours après la date de la transaction. La date à laquelle votre compte bancaire sera débité sera affichée sur votre relevé de compte PayPal et dans un email qui vous sera envoyé.</p><p class=\"pad_termsConditions\">Si vous sélectionnez l'option Paiement après 14 jours pour un paiement, le montant total de la transaction sera débité par prélèvement bancaire de votre compte bancaire, même si vous possédez un solde sur ce compte PayPal.</p><p class=\"pad_termsConditions\">Si le débit initial est rejeté ou si le compte n'est pas suffisamment approvisionné, vous autorisez PayPal à soumettre à nouveau l'ordre de prélèvement bancaire. Si le second débit échoue aussi, PayPal peut utiliser l'une des autres sources d'approvisionnement existantes pour obtenir le montant de la transaction. La hiérarchie des sources d'approvisionnement s'applique, conformément à la section 3.4 des Conditions d'utilisation de PayPal.</p><p class=\"pad_termsConditions\"><b>Bénéficiaire. </b>PayPal peut décider si vous pouvez utiliser ou pas le Paiement après 14 jours. Les critères d'éligibilité incluent, notamment, l'activité des transactions. En outre, seuls les clients peuvent utiliser le Paiement après 14 jours. Le Paiement après 14 jours n'est pas disponible pour un usage commercial.</p><p class=\"pad_termsConditions\"><b>Choix.</b>Vous pouvez modifier votre mode de paiement préféré individuellement pour chaque transaction. Cela signifie que vous pouvez décider à chaque fois si vous souhaitez utiliser le Paiement après 14 jours ou une autre source d'approvisionnement disponible, comme une carte bancaire, un solde ou un prélèvement bancaire, sans la fonctionnalité Paiement après 14 jours.</p><p class=\"pad_termsConditions\"><b>Suspension et résiliation du Paiement après 14 jours par PayPal.</b>PayPal est en droit, à tout moment, de résilier, d'annuler, de suspendre ou de modifier le Paiement après 14 jours, les conditions d'éligibilité pour le Paiement après 14 jours ou votre droit d'utiliser le Paiement après 14 jours. La transaction que vous avez déjà initiée sera effectuée.</p><p class=\"pad_termsConditions\"><b>Vérification de l'identité des clients.</b>Vous pouvez utiliser le Paiement après 14 jours pour des achats dont le montant peut s'élever à 15 000 EUR et plus. Cependant, dès que vous avez effectué des achats dont le montant totale s'élève à 15 000 EUR ou plus, vous devrez confirmer certaines informations relatives à votre identité. Une fois votre identité confirmée, vous pourrez continuer à utiliser le Paiement après 14 jours.</p><p class=\"pad_termsConditions\"><b>Définitions.</b>Tout terme non défini dans le présent accord a la signification énoncée dans les Conditions d'utilisation de PayPal.</p></div>");}body_0.__dustBody=!0;return body_0;})(dust);
