(function(dust){dust.register("wallet\/overpanel\/bank\/termsAndCondition_BR",body_0);function body_0(chk,ctx){return chk.w("<p>Ces Conditions d'utilisation (\"Conditions d'utilisation\") énoncent les conditions de l'accord de prélèvement bancaire entre vous et PayPal Brasil Serviços de Pagamentos Ltda. pour vous permettre d'effectuer des paiements par Compte bancaire via votre Compte PayPal.</p> <p>Dans le cadre de ces Conditions d'utilisation, les termes suivants sont définis comme suit :</p> <p>\"PayPal\" désigne PayPal Brasil Serviços de Pagamentos Ltda.;</p> <p>\"Vous\" ou \"Je\" désigne le titulaire du Compte bancaire</p> <p>\"Compte PayPal\" désigne le compte que Vous détenez sur PayPal, par lequel PayPal Vous fournit des services de paiements</p> <p>\"Compte bancaire\" désigne le compte bancaire que Vous avez indiqué comme mode de paiement sur votre Compte PayPal, au moyen d'un prélèvement bancaire.</p> <p>Conditions générales</p> <p>1. Vous assurez être la personne apte à autoriser les virements du Compte bancaire.</p> <p>2. Vous pouvez annuler l'autorisation de prélèvement bancaire pour vos prochaines transactions à tout moment. Pour cela, supprimez le Compte bancaire du système PayPal dans l'onglet Préférences accessible après connexion au site PayPal. Vous reconnaissez toutefois que supprimer le Compte bancaire du système PayPal n'annule pas les transactions en attente que vous avez déjà lancées et autorisées.</p> <p>Vous reconnaissez que l'annulation de l'autorisation de prélèvement bancaire ne met fin à aucun contrat de services déjà existant entre PayPal et vous-même. L'autorisation s'applique uniquement au mode de paiement et n'a aucune incidence sur le contrat de services.</p> <p>4. Il est de votre responsabilité de vous assurer que le Compte bancaire est suffisamment approvisionné pour permettre les virements conformément au Contrat.</p> <p>4.1. Si le Compte bancaire n'est pas suffisamment approvisionné pour permettre un virement, ce dernier peut être annulé. Dans ces circonstances, des frais et/ou intérêts peuvent vous être facturés par votre institution financière.</p> <p>4.2. Si le Compte bancaire n'est pas suffisamment approvisionné pour permettre un virement ou que vous n'acceptez pas un virement demandé, nous pouvons débiter le montant d'une source d'approvisionnement secondaire (une carte ou un compte bancaire).</p> <p>5. Le prélèvement bancaire n'est pas disponible pour tous les comptes bancaires. Consultez votre institution financière afin de vérifier si les prélèvements bancaires sont possibles avec votre Compte bancaire.</p> <p>6. Si un virement à partir du Compte bancaire doit être effectué un jour non ouvré dans l'établissement bancaire où le Compte bancaire est domicilié, celui-ci sera débité le jour ouvré suivant.</p> <p>7. Pour toute demande, contactez le Service clientèle en ligne dans l'Aide PayPal à tout moment, ou appelez le 0800 892 1555 de 9h00 à 18h00, du lundi au samedi. Dans toutes vos communications, précisez vos nom et adresse, le nom de votre compte et votre numéro de téléphone.</p> <p>8. Nous ne divulguons aucune information personnelle de nos clients, à l'exception des informations fournies à l'établissement bancaire tenu d'initier le virement vers le Compte bancaire. Nous pouvons également divulguer ces informations aux établissements bancaires concernés dans le cadre d'une réclamation ou d'un débit présumé incorrect ou injustifié, ou si exigé par la loi.</p> <p>9. Pendant la durée du présent Contrat, le Compte bancaire sera débité par PayPal.</p>");}body_0.__dustBody=!0;return body_0;})(dust);
